/*Table structure for table `b_airport` */

DROP TABLE IF EXISTS `b_airport`;

CREATE TABLE `b_airport` (
  `AIRPORTNAMECN` varchar(100) DEFAULT NULL COMMENT '机场中文名',
  `PINYINNAME` varchar(100) DEFAULT NULL COMMENT '机场拼音名',
  `AIRPORTNAMEEN` varchar(100) DEFAULT NULL COMMENT '机场英文名',
  `PINYINSHORTNAME` varchar(50) DEFAULT NULL COMMENT '机场拼音简拼',
  `AIRPORTCODE` varchar(3) DEFAULT NULL COMMENT '机场三字码',
  `COUNTRYNAMECN` varchar(100) DEFAULT NULL COMMENT '所在国家中文名',
  `COUNTRYNAMEEN` varchar(100) DEFAULT NULL COMMENT '所在国家英文名',
  `COUNTRYCODE` varchar(2) DEFAULT NULL COMMENT '所在国家二字码',
  `AREANAMECN` varchar(100) DEFAULT NULL COMMENT '所在区域名称',
  `AREANAMEEN` varchar(100) DEFAULT NULL COMMENT '所在区域英文名',
  `CITYNAMECN` varchar(100) DEFAULT NULL COMMENT '所在城市名称',
  `CITYCODE` varchar(3) DEFAULT NULL COMMENT '所在城市三字码',
  `ISDOMESTIC` int(1) NOT NULL DEFAULT '1' COMMENT '是否国内',
  `ID` int(19) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `AIRPORTABREVNAMECN` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`ID`)
