/* Procedure structure for procedure `generate_orderNo` */

/*!50003 DROP PROCEDURE IF EXISTS  `generate_orderNo` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `generate_orderNo`(IN orderNamePre CHAR(4), IN num INT, OUT newOrderNo VARCHAR(25))
BEGIN    
  DECLARE currentDate VARCHAR (15) ;-- 当前日期,有可能包含时分秒     
  DECLARE maxNo INT DEFAULT 0 ; -- 离现在最近的满足条件的订单编号的流水号最后5位，如：SH2013011000002的maxNo=2     
  DECLARE oldOrderNo VARCHAR (25) DEFAULT '' ;-- 离现在最近的满足条件的订单编号     
      
  IF num = 8 THEN -- 根据年月日生成订单编号     
    SELECT DATE_FORMAT(NOW(), '%Y%m%d') INTO currentDate ;-- 订单编号形式:前缀+年月日+流水号，如：SH2013011000002     
  ELSEIF num = 14 THEN -- 根据年月日时分秒生成订单编号     
    SELECT DATE_FORMAT(NOW(), '%Y%m%d%H%i%s') INTO currentDate ; -- 订单编号形式：前缀+年月日时分秒+流水号，如：SH2013011010050700001,个人不推荐使用这种方法生成流水号     
  ELSE -- 根据年月日时分生成订单编号     
    SELECT DATE_FORMAT(NOW(), '%Y%m%d%H%i') INTO currentDate ;-- 订单形式：前缀+年月日时分+流水号,如：SH20130110100900005     
  END IF ;    
      
  SELECT IFNULL(orderNo, '') INTO oldOrderNo     
  FROM test_orders     
  WHERE SUBSTRING(orderNo, 5, num) = currentDate     
    AND SUBSTRING(orderNo, 1, 4) = orderNamePre     
    AND LENGTH(orderNo) = 8 + num    
  ORDER BY ID DESC LIMIT 1 ; -- 有多条时只显示离现在最近的一条     
      
  IF oldOrderNo != '' THEN     
    SET maxNo = CONVERT(SUBSTRING(oldOrderNo, -4), DECIMAL) ;-- SUBSTRING(oldOrderNo, -4)：订单编号如果不为‘‘截取订单的最后4位     
  END IF ;    
  SELECT     
    CONCAT(orderNamePre, currentDate,  LPAD((maxNo + 1), 4, '0')) INTO newOrderNo ; -- LPAD((maxNo + 1), 4, '0')：如果不足4位，将用0填充左边     
      
  INSERT INTO test_orders (orderNo) VALUES (newOrderNo) ; -- 向订单表中插入数据     
  SELECT     
    newOrderNo ;    
END */$$
DELIMITER ;

